import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 72%;
  height: auto;
  background-color: var(--color-bg);
`;

const MySomething = () => {
  return (
    <>
      <Header />
      <BodyLayout>
        <Container>{children}</Container>
      </BodyLayout>
      <Footer />
    </>
  );
};

export default MySomething;
